// main js file 
import React from "react";
import ReactDOM from "react-dom";
import {ApolloProvider} from "@apollo/react-hooks";
import App from "./App";
import {client} from "./apollo";

ReactDOM.render(
    <ApolloProvider client={client}>
        <App />
    </ApolloProvider>, 
    document.querySelector("#root")
);
